Array.prototype.move = function (old_index, new_index) {
    if (new_index >= this.length) {
        var k = new_index - this.length;
        while ((k--) + 1) {
            this.push(undefined);
        }
    }
    this.splice(new_index, 0, this.splice(old_index, 1)[0]);
    return this; // for testing purposes
};

var removeNode = function (arr, obj) {
    
    arr.forEach(function (a) {
        if (a.sections.length > 0) removeNode(a.sections, obj);
        
            if (a.id == obj.id) {
                var i = arr.indexOf(obj);
                arr.splice(i, 1);
                          
        }
    });
}

var removeNodeGeneric = function (arr, obj) {
    //console.log("remove Node Generic")
    var i = arr.indexOf(obj);
    arr.splice(i, 1);
}


var app = angular.module('DocEasyApp', ['ngRoute']);

app.config(function ($routeProvider, $locationProvider) {
    // enable html5Mode for pushstate ('#'-less URLs)
    $locationProvider.html5Mode(true);
    $locationProvider.hashPrefix('!');
    $routeProvider.when("/", {
        controller: "pageController",
        templateUrl: "/web/app/views/page.html",
        caseInsensitiveMatch: true,
        title: 'Page '
    });
    $routeProvider.when("/Section/:sectionUrlKey", {
        controller: "homeController",
        templateUrl: "/web/app/views/home.html",
        caseInsensitiveMatch: true,
        title: 'Section '
    });
    $routeProvider.when("/Page/:pageUrlKey", {
        controller: "pageController",
        templateUrl: "/web/app/views/page.html",
        caseInsensitiveMatch: true,
        title: 'Page '
    });
    $routeProvider.when("/Search/:terms", {
        controller: "searchController",
        templateUrl: "/web/app/views/search.html",
        caseInsensitiveMatch: true,
        title: 'Search '
    });
    $routeProvider.when("/Users", {
        controller: "userController",
        templateUrl: "/web/app/views/users.html",
        caseInsensitiveMatch: true,
        title: 'Users '
    });
    $routeProvider.otherwise({ redirectTo: "/" });

});

var serviceBase = '/api';
app.constant('ngAuthSettings', {
    apiServiceBaseUri: serviceBase
});

app.directive('ngEnter', function () {
    return function (scope, element, attrs) {
        element.bind("keydown keypress", function (event) {
            if (event.which === 13) {
                scope.$apply(function () {
                    scope.$eval(attrs.ngEnter);
                });

                event.preventDefault();
            }
        });
    };
});

app.directive('includeReplace', function () {
    return {
        require: 'ngInclude',
        restrict: 'A', /* optional */
        link: function (scope, el, attrs) {
            el.replaceWith(el.children());
        }
    };
});

app.run(function () {
    
});

app.factory('sectionCache', function ($cacheFactory) {
    return $cacheFactory('sectionCache', {});
})



'use strict';
app.factory('settingsService', ['$http', 'ngAuthSettings', function ($http, ngAuthSettings) {

    function makeid() {
        var text = "";
        var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

        for (var i = 0; i < 20; i++)
            text += possible.charAt(Math.floor(Math.random() * possible.length));

        return text;
    }
    var serviceBase = ngAuthSettings.apiServiceBaseUri;

    var settingServiceFactory = {};
    var _getSettings = function () {

        return $http.get(serviceBase + '/Settings/GetSettings').then(function (results) {
            return results;
        });
    };
    

    settingServiceFactory.getSettings = _getSettings;

    return settingServiceFactory;

}]);
'use strict';
app.factory('sectionService', ['$http', 'ngAuthSettings', function ($http, ngAuthSettings) {

    function makeid() {
        var text = "";
        var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

        for (var i = 0; i < 20; i++)
            text += possible.charAt(Math.floor(Math.random() * possible.length));

        return text;
    }
    var serviceBase = ngAuthSettings.apiServiceBaseUri;
    var sectionServiceFactory = {};
    var _getSectionsLazy = function () {

        return $http.get(serviceBase + '/Sections/SectionHeaders').then(function (results) {
            return results;
        });
    };
    var _getSection = function (id) {

        return $http.get(serviceBase + '/Sections/GetSection/' + id).then(function (results) {
            return results;
        });


    };

   

    sectionServiceFactory.getSectionsLazy = _getSectionsLazy;
    sectionServiceFactory.getSection = _getSection;

    return sectionServiceFactory;

}]);
'use strict';
app.factory('searchService', ['$http', 'ngAuthSettings', function ($http, ngAuthSettings) {

    var serviceBase = ngAuthSettings.apiServiceBaseUri;
    var searchServiceFactory = {};

    var _search = function (terms) {
      
        return $http.get(serviceBase + '/Search/Search/'+terms).then(function (results) {
            return results;
        });
    };
  
    searchServiceFactory.search = _search;

    return searchServiceFactory;


}]);
'use strict';
app.factory('pageService', ['$http', 'ngAuthSettings', function ($http, ngAuthSettings) {

    function makeid() {
        var text = "";
        var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

        for (var i = 0; i < 20; i++)
            text += possible.charAt(Math.floor(Math.random() * possible.length));

        return text;
    }
    var serviceBase = ngAuthSettings.apiServiceBaseUri;
    var pageServiceFactory = {};
    var _getPagesLazy = function () {

        return $http.get(serviceBase + '/Pages/PageHeaders').then(function (results) {
            return results;
        });
    };
    var _getPage = function (id) {

        return $http.get(serviceBase + '/Pages/GetPage/' + id).then(function (results) {
            return results;
        });


    };

    pageServiceFactory.getPagesLazy = _getPagesLazy;
    pageServiceFactory.getPage = _getPage;
    return pageServiceFactory;

}]);
'use strict';
app.factory('loadingService', [ function () {

    var loadingServiceFactory = {};
    var show = true;
    var _showLoader = function () {
        
        setTimeout(function () { if (show) { $(".loader").show(); } else { show = true; } }, 300);
    };

    var _hideLoader = function () {
        show = false;
        $(".loader").hide();
    };

    loadingServiceFactory.showLoader = _showLoader;
    loadingServiceFactory.hideLoader = _hideLoader;
    return loadingServiceFactory;

}]);
'use strict';
app.controller('searchController', ['$scope','loadingService', 'searchService', '$routeParams', '$sce', '$location', function ($scope,loadingService, searchService, $routeParams, $sce, $location) {
    var vm = this;
    vm.scope = $scope;
    vm.scope.terms = $routeParams.terms;
    vm.scope.results = [];
    loadingService.showLoader();
    searchService.search(vm.scope.terms).then(function (result) {
        vm.scope.results = result.data;
        loadingService.hideLoader();
    }, function (error) {
        loadingService.hideLoader();
        dhtmlx.message({ type: "error", text: "Error searching index" })
    });
   
    vm.scope.formatSearchLink = function (result) {
        return "/" + result.type + "/" + result.urlKey;
    }

    vm.scope.formatSearchLinkWithDomain = function (result) {
        return window.location.host  + vm.scope.formatSearchLink(result);
    }
}]);
'use strict';
app.controller('pageController', ['$scope','loadingService', 'pageService', '$routeParams', '$sce', '$location', function ($scope,loadingService, pageService, $routeParams, $sce, $location) {
    var vm = this;
    vm.pageUrlKey = $routeParams.pageUrlKey;
    vm.scope = $scope;
    vm.scope.content = '';
    vm.scope.page = {};
    
    if (typeof vm.pageUrlKey == "undefined") {
        vm.pageUrlKey = "_home";
    }

    loadingService.showLoader();
    pageService.getPage(vm.pageUrlKey).then(function (result) {
        vm.scope.page = result.data;
        vm.scope.content = $sce.trustAsHtml(vm.scope.page.content + vm.scope.postRender());
        vm.scope.sidebarContent = $sce.trustAsHtml(vm.scope.page.sideBarContent);
        loadingService.hideLoader();
       
    }, function (error) {
        loadingService.hideLoader();
        // invoke loggingAndErrorService
    });

    vm.scope.postRender = function () {
        return "<script>$('pre code').each(function (i, block) { hljs.highlightBlock(block);});</script>";
    }
   

}]);
'use strict';
app.controller('homeController', ['$scope','loadingService', 'sectionService', '$routeParams', '$sce', '$location', function ($scope,loadingService, sectionService, $routeParams, $sce, $location) {
    var vm = this;
    vm.sectionUrlKey = $routeParams.sectionUrlKey;
    vm.scope = $scope;
    vm.scope.section = {};
    loadingService.showLoader();
   
    
    sectionService.getSection(vm.sectionUrlKey).then(function (result) {
        
        vm.scope.section = result.data;
        vm.scope.content = $sce.trustAsHtml(vm.scope.section.content + vm.scope.postRender());
        loadingService.hideLoader();
    }, function (error) {
        loadingService.hideLoader();
        // invoke loggingAndErrorService
    });

    vm.scope.postRender = function () {
        return "<script>$('pre code').each(function (i, block) { hljs.highlightBlock(block);});</script>";
    }
    
}]);

app.controller('appController', ['$scope','loadingService', 'sectionService', 'pageService','settingsService','$location', function ($scope,loadingService, sectionService, pageService,settingsService,$location) {
    $scope.headerUrl = "/web/app/views/header.html"
    $scope.footerUrl = "/web/app/views/footer.html"
    
    var vm = this;
    vm.scope = $scope;
    vm.scope.sections = [];
    vm.scope.pages = [];
    vm.scope.selectedSection = {};
    vm.scope.selectedPage = {};
    vm.scope.header = {};
    
    settingsService.getSettings().then(function (results) {
        vm.scope.header = results.data;
        vm.scope.headerloaded = true;
    }, function (error) {

        // invoke loggingAndErrorService
    });
    
    var applyExpanded = function (list, key) {
        if (key == '') { return list; }
        for (l in list) {
            if (list[l].sections) {
                for (s in list[l].sections) {
                    if (list[l].sections[s].urlKey) {
                        if (list[l].sections[s].urlKey.toLowerCase() == key) {
                            list[l].expanded = true;
                        }
                    }
                }
                l.sections = applyExpanded(l.sections, key);
            }
        }
        return list;
    }

    sectionService.getSectionsLazy().then(function (results) {
        var key = '';
        var path = window.location.pathname.split('/');
        if (path[1].toLowerCase() == 'section') {
            key = path[2].toLowerCase();
        }
        vm.scope.sections = applyExpanded(results.data, key);
    }, function (error) {
       
        // invoke loggingAndErrorService
    });
    
    pageService.getPagesLazy().then(function (results) {
        vm.scope.pages = results.data;
      
    }, function (error) {
       
        // invoke loggingAndErrorService
    });
   
    

    vm.scope.renderSection = function (section) {
        vm.scope.selectedSection = section;
    }
    vm.scope.search = function (term) {
        $location.path('/Search/' + term);
        vm.scope.searchTerm = '';
    }
    
}]);
